import React, { Component } from "react";
import './Menu.css'

export class Menu extends Component{
    
    render () {
        return (
          <main>
              {this.props.cont.map(el => (
                  <Menu onShowCont={this.props.onShowCont} key ={el.id} item={el}/>
              ))}
          </main>
        )
      }
}

export default Menu
